(613, 'Transaction Currency', 'MODULE_PAYMENT_PAYPALWPP_CURRENCY', 'Selected Currency', 'Which currency should the order be sent to PayPal as? <br />NOTE: if an unsupported currency is sent to PayPal, it will be auto-converted to USD (or GBP if using UK account)<br /><strong>Default: Selected Currency</strong>', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'Selected Currency\', \'Only USD\', \'Only AUD\', \'Only CAD\', \'Only EUR\', \'Only GBP\', \'Only CHF\', \'Only CZK\', \'Only DKK\', \'Only HKD\', \'Only HUF\', \'Only JPY\', \'Only NOK\', \'Only NZD\', \'Only PLN\', \'Only SEK\', \'Only SGD\', \'Only THB\', \'Only MXN\', \'Only ILS\', \'Only PHP\', \'Only TWD\', \'Only BRL\', \'Only MYR\', \'Only TRY\', \'Only INR\'), ', NULL),
(614, 'Allow eCheck?', 'MODULE_PAYMENT_PAYPALEC_ALLOWEDPAYMENT', 'Any', 'Do you want to allow non-instant payments like eCheck/EFT/ELV?', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'Any\', \'Instant Only\'), ', NULL),
(615, 'Fraud Mgmt Filters - FMF', 'MODULE_PAYMENT_PAYPALWPP_EC_RETURN_FMF_DETAILS', 'No', 'If you have enabled FMF support in your PayPal account and wish to utilize it in your transactions, set this to yes. Otherwise, leave it at No.', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'No\', \'Yes\'), ', NULL),
(616, 'API Signature -- Username', 'MODULE_PAYMENT_PAYPALWPP_APIUSERNAME', 'shirleyroadrecords_api1.gmail.com', 'The API Username from your PayPal API Signature settings under *API Access*. This value typically looks like an email address and is case-sensitive.', 6, 25, NULL, '2021-05-29 22:30:11', NULL, NULL, NULL),
(617, 'API Signature -- Password', 'MODULE_PAYMENT_PAYPALWPP_APIPASSWORD', 'HLF4ABQUMV824UUY', 'The API Password from your PayPal API Signature settings under *API Access*. This value is a 16-character code and is case-sensitive.', 6, 25, NULL, '2021-05-29 22:30:11', 'zen_cfg_password_display', 'zen_cfg_password_input(', NULL),
(618, 'API Signature -- Signature Code', 'MODULE_PAYMENT_PAYPALWPP_APISIGNATURE', 'AGs52InFHk3cJ5j80u2Udq.A26J4A.bvnLXqYBo31iZjXpEqWzlHTkyN', 'The API Signature from your PayPal API Signature settings under *API Access*. This value is a 56-character code, and is case-sensitive.', 6, 25, NULL, '2021-05-29 22:30:11', 'zen_cfg_password_display', '', NULL),
(619, 'PAYFLOW: User', 'MODULE_PAYMENT_PAYPALWPP_PFUSER', '', 'If you set up one or more additional users on the account, this value is the ID of the user authorized to process transactions. Otherwise it should be the same value as VENDOR. This value is case-sensitive.', 6, 25, NULL, '2021-05-29 22:30:11', NULL, NULL, NULL),
(620, 'PAYFLOW: Partner', 'MODULE_PAYMENT_PAYPALWPP_PFPARTNER', 'ZenCart', 'Your Payflow Partner name linked to your Payflow account. This value is case-sensitive.<br />Typical values: <strong>PayPal</strong> or <strong>ZenCart</strong>', 6, 25, NULL, '2021-05-29 22:30:11', NULL, NULL, NULL),
(621, 'PAYFLOW: Vendor', 'MODULE_PAYMENT_PAYPALWPP_PFVENDOR', '', 'Your merchant login ID that you created when you registered for the Payflow Pro account. This value is case-sensitive.', 6, 25, NULL, '2021-05-29 22:30:11', NULL, NULL, NULL),
(598, 'Enable this Payment Module', 'MODULE_PAYMENT_PAYPALWPP_STATUS', 'True', 'Do you want to enable this payment module?', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'True\', \'False\'), ', NULL),
(599, 'Live or Sandbox', 'MODULE_PAYMENT_PAYPALWPP_SERVER', 'live', '<strong>Live: </strong> Used to process Live transactions<br><strong>Sandbox: </strong>For developers and testing', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'live\', \'sandbox\'), ', NULL),
(600, 'Express Checkout Shortcut Button', 'MODULE_PAYMENT_PAYPALWPP_ECS_BUTTON', 'On', 'The Express Checkout Shortcut button shows up on your shopping cart page to invite your customers to pay using PayPal without having to give all their address details on your site first before selecting shipping options.<br />It has been shown to increase sales and conversions when enabled.<br />Default: On ', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'On\', \'Off\'), ', NULL),
(601, 'Express Checkout: Require Confirmed Address', 'MODULE_PAYMENT_PAYPALWPP_CONFIRMED_ADDRESS', 'Yes', 'Do you want to require that your (not-logged-in) customers use a *confirmed* address when choosing their shipping address in PayPal?<br />(this is ignored for logged-in customers)', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'Yes\', \'No\'), ', NULL),
(602, 'Express Checkout: Select Cheapest Shipping Automatically', 'MODULE_PAYMENT_PAYPALWPP_AUTOSELECT_CHEAPEST_SHIPPING', 'Yes', 'When customer returns from PayPal, do we want to automatically select the Cheapest shipping method and skip the shipping page? (making it more *express*)<br />Note: enabling this means the customer does *not* have easy access to select an alternate shipping method (without going back to the Checkout-Step-1 page)', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'Yes\', \'No\'), ', NULL),
(194, 'Include Tax', 'MODULE_ORDER_TOTAL_GROUP_PRICING_INC_TAX', 'false', 'Include Tax value in amount before discount calculation?', 6, 6, NULL, '2021-05-29 16:00:38', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
