(603, 'Express Checkout: Skip Payment Page', 'MODULE_PAYMENT_PAYPALWPP_SKIP_PAYMENT_PAGE', 'Yes', 'If the customer is checking out with Express Checkout, do you want to skip the checkout payment page, making things more *express*? <br /><strong>(NOTE: The Payment Page will auto-display regardless of this setting if you have Coupons or Gift Certificates enabled in your store.)</strong>', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'Yes\', \'No\'), ', NULL),
(604, 'Express Checkout: Automatic Account Creation', 'MODULE_PAYMENT_PAYPALWPP_NEW_ACCT_NOTIFY', 'Yes', 'If a visitor is not an existing customer, a Zen Cart account is created for them.  Would you like make it a permanent account and send them an email containing their login information?<br />NOTE: Permanent accounts are auto-created if the customer purchases downloads or gift certificates, regardless of this setting.', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'Yes\', \'No\'), ', NULL),
