(246, 'Products status in Catalog when out of stock should be set to', 'SHOW_PRODUCTS_SOLD_OUT', '0', 'Show Products when out of stock<br /><br />0= set product status to OFF<br />1= leave product status ON', 9, 10, NULL, '2021-05-29 16:00:38', NULL, 'zen_cfg_select_option(array(\'0\', \'1\'), ', NULL),
(247, 'Disabled Product Status for Search Engines', 'DISABLED_PRODUCTS_TRIGGER_HTTP200', 'false', 'When a product is marked Disabled (status=0) but is not deleted from the database, should Search Engines still show it as Available?<br>eg:<br>True = Return HTTP 200 response<br>False = Return HTTP 410<br>(Deleting it will return HTTP 404)<br><b>Default: false</b>', 9, 10, NULL, '2021-05-29 16:00:38', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'),', NULL),
(248, 'Show Sold Out Image in place of Add to Cart', 'SHOW_PRODUCTS_SOLD_OUT_IMAGE', '1', 'Show Sold Out Image instead of Add to Cart Button<br /><br />0= off<br />1= on', 9, 11, NULL, '2021-05-29 16:00:38', NULL, 'zen_cfg_select_option(array(\'0\', \'1\'), ', NULL),
(249, 'Enable disabled product by available date', 'ENABLE_DISABLED_UPCOMING_PRODUCT', 'Automatic', 'How should hidden (disabled) product with a future available date be made visible (active) to customers when the date is reached?<br />', 9, 12, NULL, '2021-05-29 16:00:38', NULL, 'zen_cfg_select_option(array(\'Manual\', \'Automatic\'), ', NULL),
