(296, 'Enable Downloads', 'DOWNLOAD_ENABLED', 'true', 'Enable the products download functions.', 13, 1, NULL, '2021-05-29 16:00:38', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(297, 'Download by Redirect', 'DOWNLOAD_BY_REDIRECT', 'true', 'Use browser redirection for download. Disable on non-Unix systems.<br /><br />Note: Set /pub to 777 when redirect is true', 13, 2, NULL, '2021-05-29 16:00:38', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(298, 'Download by streaming', 'DOWNLOAD_IN_CHUNKS', 'false', 'If download-by-redirect is disabled, and your PHP memory_limit setting is under 8 MB, you might need to enable this setting so that files are streamed in smaller segments to the browser.<br /><br />Has no effect if Download By Redirect is enabled.', 13, 2, NULL, '2021-05-29 16:00:38', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
(299, 'Download Expiration (Number of Days)', 'DOWNLOAD_MAX_DAYS', '7', 'Set number of days before the download link expires. 0 means no limit.', 13, 3, NULL, '2021-05-29 16:00:38', NULL, '', NULL),
