(570, 'Zone 1 Countries', 'MODULE_SHIPPING_ZONES_COUNTRIES_1', 'US', 'Comma separated list of two character ISO country codes that are part of Zone 1.<br />Set as 00 to indicate all two character ISO country codes that are not specifically defined.', 6, 0, NULL, '2021-05-29 20:27:43', NULL, 'zen_cfg_textarea(', NULL),
(571, 'Zone 1 Shipping Table', 'MODULE_SHIPPING_ZONES_COST_1', '1:2.85,3:4.50,5:10.50,99:20.00', 'Shipping rates to Zone 1 destinations based on a group of maximum order weights/prices. Example: 3:8.50,7:10.50,... Weight/Price less than or equal to 3 would cost 8.50 for Zone 1 destinations.<br />You can end the last amount as 10000:7% to charge 7% of the Order Total', 6, 0, NULL, '2021-05-29 20:27:43', NULL, 'zen_cfg_textarea(', NULL),
(572, 'Zone 1 Handling Fee', 'MODULE_SHIPPING_ZONES_HANDLING_1', '0', 'Handling Fee for this shipping zone', 6, 0, NULL, '2021-05-29 20:27:43', NULL, NULL, NULL),
(573, 'Handling Per Order or Per Box Zone 1  (when by weight)', 'MODULE_SHIPPING_ZONES_HANDLING_METHOD_1', 'Order', 'Do you want to charge Handling Fee Per Order or Per Box?', 6, 0, NULL, '2021-05-29 20:27:43', NULL, 'zen_cfg_select_option(array(\'Order\', \'Box\'), ', NULL),
(574, 'Zone 2 Countries', 'MODULE_SHIPPING_ZONES_COUNTRIES_2', 'MX, CA', 'Comma separated list of two character ISO country codes that are part of Zone 2.<br />Set as 00 to indicate all two character ISO country codes that are not specifically defined.', 6, 0, NULL, '2021-05-29 20:27:43', NULL, 'zen_cfg_textarea(', NULL),
(575, 'Zone 2 Shipping Table', 'MODULE_SHIPPING_ZONES_COST_2', '1:2.85,3:4.50,5:10.50,99:20.00', 'Shipping rates to Zone 2 destinations based on a group of maximum order weights/prices. Example: 3:8.50,7:10.50,... Weight/Price less than or equal to 3 would cost 8.50 for Zone 2 destinations.<br />You can end the last amount as 10000:7% to charge 7% of the Order Total', 6, 0, NULL, '2021-05-29 20:27:43', NULL, 'zen_cfg_textarea(', NULL),
