(579, 'Zone 3 Shipping Table', 'MODULE_SHIPPING_ZONES_COST_3', '3:8.50,7:10.50,99:20.00', 'Shipping rates to Zone 3 destinations based on a group of maximum order weights/prices. Example: 3:8.50,7:10.50,... Weight/Price less than or equal to 3 would cost 8.50 for Zone 3 destinations.<br />You can end the last amount as 10000:7% to charge 7% of the Order Total', 6, 0, NULL, '2021-05-29 20:27:43', NULL, 'zen_cfg_textarea(', NULL),
