(624, 'Debug Mode', 'MODULE_PAYMENT_PAYPALWPP_DEBUGGING', 'Off', 'Would you like to enable debug mode?  A complete detailed log of failed transactions will be emailed to the store owner.', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'Off\', \'Alerts Only\', \'Log File\', \'Log and Email\'), ', NULL),
(625, 'PayPal Merchant ID', 'MODULE_PAYMENT_PAYPALWPP_MERCHANTID', 'R674TZEUVZR7W', 'Enter your PayPal Merchant ID here. This is used for the more user-friendly In-Context checkout mode. You can obtain this value by going to your PayPal account, clicking on your account name at the top right, then clicking Account Settings, and navigating to the Business Information section; You will find your Merchant Account ID on that screen. A typical Merchant ID looks like FDEFDEFDEFDE11.', 6, 25, NULL, '2021-05-29 22:30:11', NULL, NULL, NULL),
(626, 'Use InContext Checkout?', 'MODULE_PAYMENT_PAYPALWPP_CHECKOUTSTYLE', 'InContext', 'PayPal now offers a newer friendlier InContext (in-page) checkout mode (Requires that you enter your MerchantID in the Merchant ID Setting above). Or you can use the older checkout style which offers Pay Without Account by default but with a full-page-redirect.', 6, 25, NULL, '2021-05-29 22:30:11', NULL, 'zen_cfg_select_option(array(\'InContext\', \'Old\'), ', NULL),
(638, 'Shipping Zone', 'MODULE_SHIPPING_FLAT_ZONE', '2', 'If a zone is selected, only enable this shipping method for that zone.', 6, 0, NULL, '2021-09-12 15:36:54', 'zen_get_zone_class_title', 'zen_cfg_pull_down_zone_classes(', NULL),
