(640, 'Show Queue in Admin header?', 'MODULE_ORDER_TOTAL_GV_SHOW_QUEUE_IN_ADMIN', 'true', 'Show Queue button on all pages of Admin?<br>(Will auto-hide if nothing in queue, and will auto-display on \'Orders\' screen, regardless of this setting)', 6, 3, NULL, '2021-09-12 15:56:51', NULL, 'zen_cfg_select_option(array(\'true\', \'false\'), ', NULL),
