(643, 'Shipping Table', 'MODULE_SHIPPING_TABLE_COST', '25:8.50,50:5.50,10000:0.00', 'The shipping cost is based on the total cost or weight of items or count of the items. Example: 25:8.50,50:5.50,etc.. Up to 25 charge 8.50, from there to 50 charge 5.50, etc<br />You can also use percentage amounts, such 25:8.50,35:5%,40:9.50,10000:7% to charge a percentage value of the Order Total', 6, 0, NULL, '2021-10-21 01:21:57', NULL, 'zen_cfg_textarea(', NULL),
(644, 'Table Method', 'MODULE_SHIPPING_TABLE_MODE', 'weight', 'The shipping cost is based on the order total or the total weight of the items ordered or the total number of items orderd.', 6, 0, NULL, '2021-10-21 01:21:57', NULL, 'zen_cfg_select_option(array(\'weight\', \'price\', \'item\'), ', NULL),
