(2, 1, 'Leachate - Gentrified Swamp CD', 'Debut album from North Carolina\'s premier false grind act\r\n\r\nRecorded October 2019 at Pawpaw\'s House, Boone, NC\r\n\r\nTLAL 188 / SRR 024\r\n\r\nreleased April 24, 2020\r\n\r\nBloodnote - Guitars/Vocals\r\nEyn - Bass/Vocals\r\nGrindarious - Drums/Vocals\r\n\r\nGang Vox on Gentrified Swamp:\r\nReilly Appert\r\nCameron Price\r\nBrady Trax\r\nOwen Myers\r\nConnor White\r\n\r\nVox on After Endless Pontification by Lord Zaros\r\n\r\nJohn Toth - Track 1 Sample\r\n\r\nReilly Appert: Recording Engineer\r\n\r\nArtwork by Lord Zaros\r\nwww.facebook.com/lordzaros666/\r\nLogo by Leroy Paul\r\nwww.facebook.com/blotteracidfreakout/\r\n\r\nStream it: https://open.spotify.com/album/3iVF3SDCw9xGTjqJ2ZJGLI?si=Lot69B4VTIuE6b1lIPgV1g&dl_branch=1', '', 0),
