(4, 1, 'Various Artists - Unholy Fiends, Vol. 2 CD', 'Volume 2 of the Unholy Fiends comp series. Every band featured is made up of Blast Fiend members.\r\ncredits\r\nreleased January 26, 2018\r\n\r\nBands:\r\nOse\r\nCold Dead Hands\r\nAbhorrent Deformity\r\nRemission\r\nHollow World\r\nCarnosus\r\nCryptic Abyss\r\nThe Course is Black\r\nBog Wraith\r\nVenomSpreader\r\nEmbodiment (UK)\r\nHorns of Baphomet\r\nLeachate\r\nHit the Shadows\r\nDrezik\r\nAsymptomatic\r\nDead World Reclemation\r\nProsper or Perish\r\nBanter\r\n\r\nArtists:\r\nTony Garret @tinytigertattoos\r\nKimi Kaste @kiwikaste\r\n\r\nStream it: https://shirleyroadrecords.bandcamp.com/album/unholy-fiends-vol-2-srr-008', '', 0),
(5, 1, 'Various Artists - Unholy Fiends, Vol. 1 CD', '1. Carnosus - Shores of Oblivion 03:46\r\n2. Ordnance - Chasma: Substrate 04:24\r\n3. The Savage Seven - Cold Sweat 05:02\r\n4. Tides Apart - Crown of Thorns 03:55\r\n5. My Will Be Done - Cast Your Darkness Upon Them 04:02\r\n6. Hit the Shadows - Triumph 04:27\r\n7. Azurah - Barokad 05:42\r\n8. Bog Wraith - Call to the Marshlands 03:19\r\n9. bloodnote - public disappointment 00:10\r\n10. Banter - Human Decomposition Stain 02:58\r\n11. Septik Piggery - FLESH 04:14\r\n12. Atrinity - Eye for an Eye 04:05\r\n13. Asymptomatic - No Choice 04:03\r\n14. Drezik - Left for Dead 04:15\r\n15. najtrows - indeed it is winter 04:37\r\n16. Grvey - MSK ON (Prod. Trvshgod) 02:42\r\n\r\nBorn out of a mutual love of The Black Dahlia Murder, Shirley Road Records presents Unholy Fiends: A Blast Fiends Compilation. Every band featured here is a certified Blast Fiend, and this comp would not exist without the inspiration the band has given us all. To TBDM we say thank you. To everyone else, enjoy.\r\n\r\nreleased September 29, 2017\r\n\r\nStream it: https://shirleyroadrecords.bandcamp.com/album/unholy-fiends-b-f-compilation-srr-004', '', 0),
