(47, 1, 'Sidetracked - Hollowed Out CS', 'Stream it here: music.tolivealie.com/album/hollowed-out\r\n\r\nTacoma Washingtons SIDETRACKED has been up and down the coasts, playing fests, putting out dozens of releases, and being an amazing fast hardcore band for almost twenty years and you know the one thing that they are missing? A full length record. From the same label that brought you full lengths from bands like XBRAINIAX and HUMMINGBIRD OF DEATH that had been so fast they have only graced records from 5s to 7s before then, we present to you the first full length by fast hardcore titans SIDETRACKED. With angular hooks, false hits, starts and stops, this is pure fastcore perfection. The weirdest thing is youll want to hear more after you listen to the twenty-four tracks carved into the vinyl on this one. Poised to be one of the most important fastcore releases in 2019, dont sleep on Hollowed Out.\r\n\r\nreleased October 18, 2019\r\n\r\nBass  Andrew Gentz\r\nDrums  Brian Skiffington\r\nPhotography [Band Photo]  Kevin Moe\r\nPhotography [Front And Back Photo]  Matt Gomes\r\nRecorded By  Bob Reed\r\nVocals, Guitar  Jay Tichy', '', 0),
