(54, 1, 'Feral Spectre  Crepuscular Evil CS', 'Stream it at feralspectre.bandcamp.com/releases\r\n\r\nTracked live at The Cabin ov Eternal Despair July 2019\r\n\r\nreleased February 3, 2020\r\n\r\nReleased via Blasphemous Mockery Productions\r\nLogo art by Maro Colon\r\n\r\nDemiurge - Vocals, Guitar, Bass, Lyrics\r\nAguul - Drums, Vocals, Additional Lyrics', '', 0),
(55, 1, 'ACxDC- Discography 03-13: Double CS', 'Stream here: https://music.tolivealie.com/album/discography-lp\r\n\r\n*NOTE: Both cassettes are smoke colored. Red ones in the picture are sold out*\r\n\r\n\"ANTICHRIST DEMONCORE or ACxDC for short aren\'t your stereotypical satanic grindviolence band. This picture disc stitches together 23 heavy hitting studio tracks on the first tape the second tape there are 28 live and demo tape tracks. After constant touring of the US and overseas, many out of print releases, and a new LP out, this material gets catches you up to their new LP with everything to that point. Only 100 copies on double cassettes and 250 on smokey gray double cassettes. Professionally duplicated, housed in a double butterfly Norelco case, and factory shrink-wrapped.\" - To Live A Lie Records\r\n\r\nreleased June 30, 2013', '', 0),
(56, 1, 'Goreatorium  Homicidal Ideation / Live Extermination', 'Stream here: https://open.spotify.com/album/5zIKwjELNz6Ga7BBwdpXN3?si=UFrwlVuPThymYBIDNh__qw&dl_branch=1\r\n\r\nreleased February 19, 2021\r\n\r\nZombi Holocaust - Drums\r\nDr. Death - Vocals\r\nEl Maniaco - Bass\r\nRawhead Rex - Guitars\r\nJorge \"Grind\" Lopez - Guitars', '', 0),
(57, 1, 'Frail Body / Infant Island / massa nera / dianacrawls  split CS', 'Stream here: https://open.spotify.com/album/6a5edfWWYJgzN3o2Llr23s?si=Y9o2LIqqTj-RGz_WORAE9g&dl_branch=1\r\n\r\nreleased October 9, 2019\r\n\r\nTHE BANDS ON THIS SPLIT ARE\r\nFRAIL BODY: frailbodyil.bandcamp.com\r\n\r\n\r\nINFANT ISLAND: infantisland.bandcamp.com\r\nVocals performed by Daniel Kost.\r\nGuitar & additional vocals performed by Alexander Rudenshiold.\r\nBass played by Kyle Guerra.\r\nDrums played by James Rakestraw.\r\n\r\nThis song was primarily engineered, recorded, and mixed by Thomas Carney at Heckingers in Richmond, Virginia.\r\nOverdubs engineered and recorded by Drake Dragone at The Pat Norwood Studio in Fredericksburg, Virginia.\r\nViolin played by Drake Dragone.\r\n\r\nMASSA NERA: massanera.bandcamp.com\r\n\r\nDIANACRAWLS: dianacrawls.bandcamp.com\r\n\r\nTHIS RECORD WAS MASTERED BY CARL SAFFAT SAFF MASTERING IN CHICAGO, IL.\r\n\r\nTHE ARTWORK WAS CREATED BY MYLES KARR.\r\nTHE LAYOUT WAS ARRANGED BY ALEXANDER RUDENSHIOLD\r\n\r\n\r\nThe labels which helped to release this are:\r\nMiddle Man Records / MMR132\r\nDickcrushrecords / DCR113\r\nSantapogue Media / SANTA062\r\nR.i.p. In Peace Records / RIPR-013\r\nZegema Beach Records / ZBR145\r\nDingleberry Records / DBR 345\r\nPundonor Records / PUN26\r\nBlessedhands Records / BHR032\r\nDaesin Records / DAS015\r\nListen To Aylin Records / LTA12\r\nA Fond Dcale Productions / AFC17\r\nDance Happy Doom Crew / DHDC005\r\ni.corrupt Records / ICR064\r\nLeft Hand Label / LHL014\r\nNo Funeral Records / NF-012\r\nPeople Places Records / PRR | 011\r\nLe Blast Records / LBR-032', '', 0),
(58, 1, 'God\'s America - The Undeserving CS', 'Stream here: https://godsamerica.bandcamp.com/album/the-undeserving-ep\r\n\r\nreleased December 25, 2017', '', 0),
(59, 1, 'Hallucination Realized  Made Hostage To Your Psyche CS', 'Stream here: https://open.spotify.com/album/0pirEPjrlOUqnGFprt8nBP?si=QXHPfzUyQ5KDMTZVWOhqzQ&dl_branch=1\r\n\r\nreleased October 12, 2018', '', 0),
(60, 1, 'Hummingbird of Death - Forbidden Techniques CS', 'Stream here: https://open.spotify.com/album/06783QjSTIhzG2FISnA5j1?si=Rf_6PNQ_T4-lj6RL1ICcGA&dl_branch=1\r\n\r\n\"They say that it takes ten thousand hours to master anything. Using that logic, Boise\'s HUMMINGBIRD OF DEATH has then practiced a bit over two hours a day for their twelve years as a band to hit this mark right before going into the studio to record Forbidden Techniques because the Boise boys have put together an absolute masterpiece. Twenty four songs in twenty four minutes will decimate your mind and memory for twenty four hours after listening. HOD has been perfecting their song and taken nods from NEOS, LARM, ELECTRO-HIPPIES, and all things fast and has taken twelve days in the studio formulating a fastcore mental maze of weaving/looping riffs and runs that will leave you breathless and satisfied. This is the best recording, best effort, and best material of the ever-evolving purveyors of playing faster than fast.\"\r\n\r\nreleased October 18, 2019', '', 0),
(61, 1, 'Leachate - Gentrified Swamp CS', 'Stream here: https://open.spotify.com/album/3iVF3SDCw9xGTjqJ2ZJGLI?si=YY_IN0ITRE28x_W1cnMabg&dl_branch=1\r\n\r\nRecorded October 2019 at Pawpaw\'s House, Boone, NC\r\n\r\nTLAL 188 / SRR 024\r\n\r\nreleased April 24, 2020\r\n\r\nCJ Coronado - Guitars/Vocals\r\nAndrew Nye - Bass/Vocals\r\nGrindarious Ethan - Drums/Vocals\r\n\r\nGang Vox on Gentrified Swamp:\r\nReilly Appert\r\nCameron Price\r\nBrady Trax\r\nOwen Myers\r\nConnor White\r\n\r\nVox on After Endless Pontification by Lord Zaros\r\n\r\nJohn Toth - Track 1 Sample\r\n\r\nReilly Appert: Recording Engineer\r\n\r\nArtwork by Lord Zaros\r\nwww.facebook.com/lordzaros666/\r\nLogo by Leroy Paul\r\nwww.facebook.com/blotteracidfreakout/\r\nPhysical layout by Will Butler', '', 0),
(62, 1, 'Lesser Life  Bone Deep & Numbing CS', 'Stream here: https://open.spotify.com/album/6R5j9yyIIeQjoQMAGRQviL?si=bhmPM0oVQb2LM-KEMV9P_Q&dl_branch=1\r\n\r\nRecorded by Kris Hilbert at Legitimate Business in Greensboro, NC.\r\nMixed and mastered by Colin Marston at Menegroth, The Thousand Caves in NYC.\r\nArt by Seals of Blackening www.instagram.com/sealsofblackening/', '', 0),
(63, 1, 'Mediated Form - A Demonstration of Mankind\'s Supremacy CS', 'Stream here: https://open.spotify.com/album/0SD2DzozunpUjZr3Cadbg7?si=qtxTW1XbRu-TWMqPmdu6RA&dl_branch=1\r\n\r\nreleased August 31, 2019\r\n\r\nRecorded by Cody Baresich at Circle A Studios, Victoria, BC, Canada.\r\nMastered by Greg Wilkinson at Earhammer Studios, Oakland, CA, USA.\r\nArt/photography by Ailn  Dlaigh.\r\n\r\nMEDIATED FORM is TYLER | SAM | AILN', '', 0),
(64, 1, 'Musket Hawk  Upside Of Sick CS', 'Stream here: https://open.spotify.com/album/2PzgnjtiE2BtrzXXf68m0c?si=yCGZkdeCTo2PBau7LiuDBg&dl_branch=1', '', 0),
(65, 1, 'Needle - S/T CS', 'Stream here: https://open.spotify.com/album/5eksfaE9Yex0xu3mJ68LUA?si=Od9tNMNsQcmuxucL76dNlg&dl_branch=1\r\n\r\nreleased July 13, 2019\r\n\r\nG-tar = Ron\r\nYells = Charlie\r\nDrumz = Aidan\r\n\r\nRecorded/Mixed by Mike Tony\r\nMastered by Sasha at Artifact\r\nArt by Clint', '', 0),
