(67, 1, 'Sardonic Smile - Der Zorn Gottes CS', 'Stream here: https://www.youtube.com/watch?v=ea5XAJNxPr8', '', 0),
(68, 1, 'JUNT / Spewtum - Split CS', 'Stream here: https://www.youtube.com/playlist?list=PLolY3k3875W9Ko5TeXPFquuTnpzX1bHym\r\n\r\nSPEWTUM ON THIS RECORDING:\r\nSTEVE - BASS, VOMITS, AND DRUM PROGRAMMING\r\nGREG - PUKES\r\n\r\nJUNT recorded live (overdubbed vox) at the horns of baphomet hq in february of 2019\r\n\r\ngrindarious - drums/vox\r\nno uh - guitars/additional vox on 3\r\nlumpy milk - bass/additional vox on 3\r\nrecording/mixing/production bs by grindarious', '', 0),
(69, 1, 'Time of Chaos / Snitchgrinder - Split CS', 'Stream here: https://notimeforfun.bandcamp.com/album/split-ntr-139\r\n\r\nCo-release with No Time Records and DESTRUKTOMUZIK', '', 0),
(70, 1, 'Tired of Everything - Silenced CS', 'Stream here: https://open.spotify.com/album/2UleVl2bMVimGU6ssXpCMW?si=p6TXi9eZT36_tbkjZqYgZg&dl_branch=1\r\n\r\n\"The very first offering of this brand new band featuring To Live A Lie Records kingpin at his first dedicated role on vocals. Additionally the band is filled out with overly competent musical members from Salmonella, Mad Dog, and Zipper. Tired of Everything have produced six stomping fist pumping hc punk anthems that spin you up and get you pissed at the world. Hardcore punk less for those who like clean haircuts and moshing but more for those who like dirtier punker side of things. It sounds like if youth crew needed to take a bath.\" - To Live A Lie Records', '', 0),
(71, 1, 'Torch Runner - Committed to the Ground CS', 'Stream here: https://open.spotify.com/album/0WjB7ngLbTJqMFBQuzyvf0?si=Qaq9FhshQI22TYKMz5F5sw&dl_branch=1\r\n\r\n\"Twelve songs in 22 minutes. And two of the songs are a combined 9 minutes of play time. You do the math and this equals grind. Ferocious, venomous grind. North Carolinas Torch Runner are devastating, and on their debut album, Committed To The Ground, these guys waste no precious seconds in letting the listener attempt to catch their breath.\r\nLike already stated, this is grind, not rocket science, so expect simple yet blistering riffs, blastbeats truncated by d-beats and monotonous vocals that are highly toxic. The production is definitely influenced by the HM-2 styled production that bands such as Trap Them have helped reinvigorate in recent years. In fact, Trap Them is a great point of reference if you were to harvest their most fast and chaotic moments. Toss in some Converge, The Secret and Napalm Death and youre close to their melting pot of grind, crust and hardcore.\r\nIve barely seen mention of these guys, but this is probably one of the most intense albums Ive heard this year (seriously, 2012, I expected more heart-rate accelerating records! Whats the deal?). Its visceral and I applaud them for producing an album of such savagery. This year has seen a lot of albums shrug off intensity in favor of artsy-ness or progressive aspirations (big generalization I realize), but just look at Decibel Magazines Top 40 records of the year. There are what, MAYBE 4 or 5 albums that Id call intense in terms of severity. Maybe Torch Runners kind of records are flash-in-the-pan and not year end list material, but Ill be damned if volume, speed and vitriol cant go toe-to-toe with any creative ambition. But I digress\r\nTorch Runner keep things very simple. In the same way a band like Nails isnt going to go off on random tangents or divert from a singular focus, Torch Runner craft each song as lesson in extremity. Essentially, there are eight songs, each averaging around 50-60 seconds long, which are broken up by four longer tracks. Those longer tracks are pretty much the same sonically, but delivered with a slower, sludgy approach. The four and a half minute The Holy Are The Broken being one of the best of the slower songs, demonstrates that you can still get pummeled even with a slower tempo (and a malevolent vibe only helps to ensure the listeners horns are raised). Sure, the band isnt breaking any new ground, but their sheer power earns them big points. While their songs may not be the most memorable, and they might not appear on year-end lists, theyre definitely filling a vacant space of intensity that for me has been sorely missed in 2012.. Super limited run on cassette tape.\" - Will Butler / To Live A Lie Records', '', 0),
(72, 1, 'Wrists - S/T CS', 'Stream here: https://open.spotify.com/album/5ZqnRhjZKtxSzEg13HLn3X?si=3c-fTPxmQi2vrrjZFeRuAQ&dl_branch=1', '', 0),
(73, 1, 'Various Artists - Sincere Flattery, Vol. 1 CS', 'Stream here: https://open.spotify.com/album/7Alzsmd2wjz1SbRya3EBSW?si=9m3WvF5hRgSw6e8BnmxCKg&dl_branch=1\r\n\r\nSlund - Sabotage (Beastie Boys cover)\r\nUncle Buck - Youth Attack (Charles Bronson cover)\r\nEndless Bore - Pressure (Negative Approach cover)\r\nNight Sweats - Coup D\'Etat (Refused cover)\r\nSidetracked - Hand That Feeds (Jenny Piccolo cover)\r\nBody Farm - My Life (Lack of Interest cover)\r\nThrone of Blood - Another Day (Scared Straight cover)\r\nTomb Warden - Infanticide (Assuck cover)\r\nAncient Torture Techniques - Charged Up (Hellnation cover)\r\nJUNT - Fuck the System (Archagathus cover) 01:29\r\nANF - Hall of Fame (Government Issue cover)\r\nGod\'s America - Dawn Patrol (Megadeth cover)', '', 0),
(74, 1, 'Sulfuric Cautery / Human Effluence - Split 12\"', 'A hyperblasting goregrind split for the ages. Sulfuric Cautery bring 7 tracks of their wall of sound visceral devestation with some of their best sounding material. Human Effluence deliver 10 tracks of gore, shredding the listeners eardrums with precise brutality. Not to be missed. On black vinyl.', '', 0),
(75, 1, 'Fed Ash / Fentanyl Tapwater - Split CS', 'Inside you are two wolves, named Fentanyl Tapwater and Fed Ash. They both want to eat you.\r\n\r\nFed Ash is a wretched mass of grinding sludge. Their dense, feedback-laden sonic assaults evoke the desperate realities of post-industrial abandonment, realities familiar to inhabitants of Western New York; a region that Fed Ash calls home. This is a lethal musical outfit, prepared to assassinate eardrums and ravage psyches.\r\n\r\nFentanyl Tapwater spit out stripped down sludge stylings, eschewing early 70s Doomery and instead discharging primitive punk grooves. Blown-out and bleak production offers the listener a discomforting glimpse into the Rust Belt. Not recommended for typical sludge listeners who just want a romp in the swamp.\r\n\r\nFF7. Limited to 120 White shell tapes. Release date may be sooner if tapes arrive sooner.\r\nreleased March 19, 2021\r\n\r\nFed Ash:\r\nCalum Calkin\r\nJason Eldridge\r\nAllie French\r\nMatthew Jaime\r\nRecorded by Ryan Dugan\r\n\r\nFentanyl Tapwater:\r\nMatt - Bass\r\nKerny - Vocals\r\nTim - Drums\r\nRecorded in Fall 2020\r\n\r\nArt by @bergen.jonathan\r\nLayout by Tyler Hammer\r\n\r\nStream here:\r\nFed Ash side: https://open.spotify.com/album/3BTuciXOaWjZLEsLOtEGgD?si=4Rero2s7T-ytj-l3LyS1hA&dl_branch=1\r\n\r\nFentanyl Tapwater side: https://www.youtube.com/watch?v=hzBecQ_1yCQ', '', 0),
(76, 1, 'Leaking Head - Demo 2021 CS', 'Punk music.\r\n\r\nreleased January 8, 2021\r\n\r\nVocal: Cougar\r\nLeft Guitar: Chainsaw\r\nRight Guitar: Razor\r\nBass: Hammer\r\nDrums: Bombs\r\n\r\nAdditional Vocal by Razor\r\nAll songs by Leaking Head expect songs \"JWAC\" and \"TVI\" by Reagan Youth and The Stooges respectively.\r\n\r\nInstruments recorded live by Hammer in Year 2020 during the fall\r\nVocals overdubbed later.\r\nMastering by Will Killingsworth at Dead Air Studios in Year 2021\r\nArtwork by Sam @pompinoprints\r\nLayout by Katie @dogbitesback\r\n\r\nStream it: https://open.spotify.com/album/3SAWIGosWtf5Y9Tb63wl3b?si=DWZXuBUdRn2CMd-CvxxwPw&dl_branch=1', '', 0),
(77, 1, 'Redundant Protoplasm - Adipose Piquerism CS', 'Goregrind\r\n\r\nreleased February 7, 2020\r\n\r\nStream it: https://open.spotify.com/album/3PXZqVdE6OGUejxv3BImks?si=ChpkPycfTAe34x7UE_cgEg&dl_branch=1', '', 0),
(78, 1, 'Nosebleed - Human Doll CS', 'Arizona Powerviolence\r\n\r\nStream it: https://www.youtube.com/watch?v=ILU2ndnwXjE', '', 0),
(79, 1, 'Wormosis - Rancid Noises From The Depths Of Hells Pit CS', 'Filthy goregrind from Wilmington, NC. This is not to be missed: over a half hour of buzzsaw guitars, thundering drums, and the most toilet bowl sounding vocals in the state.\r\n\r\nLineup:\r\nDeathpunx: Vocals/Drums\r\nFred Shitbreath: Bass\r\nKane Weat: Bubbles\r\nZen Lopex: Drums\r\n\r\n\r\nCover Art: PCB Fetus\r\nwww.instagram.com/pcb.fetus/\r\n\r\n\r\nTapes: Shirley Road Records\r\nwww.instagram.com/shirleyroadrecords/\r\nshirleyroadrecords.bandcamp.com\r\n\r\nTape Layout: Tommy Smith (No Time Records)\r\nhttps://notimerecords.com/\r\nhttps://www.facebook.com/notimerecordsOC\r\nhttps://www.instagram.com/notimerecordsoc/\r\n\r\nSpecial thanks to; Zen Lopex, Wyatt Kendall, Bobby Maggard, CJ Coronado (Shirley Road Records), NxRxMx, Mom, Dad, Bren (PCB FETUS), and anyone else who is chill with us!', '', 0),
(80, 1, 'Abhorrent Deformity - Slaughter Monolith CD', '', '', 0);
